DROP TABLE IF EXISTS cases;
DROP TABLE IF EXISTS subtypes;
DROP TABLE IF EXISTS types;
DROP TABLE IF EXISTS sessions;
DROP TABLE IF EXISTS users;

CREATE TABLE users (
  user_id SERIAL NOT NULL,
  email VARCHAR(255) NOT NULL UNIQUE,
  password VARCHAR(60),
  name VARCHAR(32) NOT NULL,
  is_admin BOOLEAN NOT NULL DEFAULT FALSE,
  PRIMARY KEY (user_id)
);

CREATE TABLE sessions (
  session_id UUID NOT NULL DEFAULT GEN_RANDOM_UUID(),
  user_id INTEGER NOT NULL,
  expires TIMESTAMP NOT NULL DEFAULT CURRENT_DATE + 90, 
  PRIMARY KEY (session_id),
  FOREIGN KEY (user_id) REFERENCES users (user_id)
);

CREATE TABLE types (
  name VARCHAR(32) NOT NULL,
  -- subtype VARCHAR(32) NOT NULL,
  PRIMARY KEY (name)
);

CREATE TABLE subtypes (
  parent VARCHAR(32) NOT NULL,
  name VARCHAR(32) NOT NULL,
  PRIMARY KEY (parent, name),
  FOREIGN KEY (parent) REFERENCES types (name)
);

CREATE TABLE cases (
  case_id SERIAL NOT NULL,
  name VARCHAR(32) NOT NULL,
  student_number VARCHAR(6),
  type VARCHAR(32),
  subtype VARCHAR(32),
  assignee INTEGER,
  is_open BOOLEAN NOT NULL DEFAULT TRUE,
  created DATE NOT NULL DEFAULT CURRENT_DATE,
  closed DATE,
  description TEXT,
  PRIMARY KEY (case_id),
  FOREIGN KEY (assignee) REFERENCES users (user_id),
  FOREIGN KEY (type, subtype) REFERENCES subtypes (parent, name)
);



